import React, { useState, useEffect } from 'react';
import { BrowserRouter as Router, Route, Routes, Navigate } from 'react-router-dom';

// Context
import { AuthProvider, useAuth } from './context/AuthContext';

// Layout components
import Navbar from './components/layout/Navbar';
import Sidebar from './components/layout/Sidebar';

// Auth pages
import Login from './components/auth/Login';
import Register from './components/auth/Register';

// Main pages
import Dashboard from './components/dashboard/Dashboard';
import Equipment from './components/equipment/Equipment';
import AddEquipment from './components/equipment/AddEquipment';
import Maintenance from './components/maintenance/Maintenance';
import SchedulePreventive from './components/maintenance/SchedulePreventive';
import ReportIssue from './components/maintenance/ReportIssue';
import Tasks from './components/tasks/Tasks';
import AddTask from './components/tasks/AddTask';
import Users from './components/users/Users';
import AddUser from './components/users/AddUser';

// Private route wrapper
import PrivateRoute from './components/routing/PrivateRoute';

// Loading screen
import LoadingScreen from './components/layout/LoadingScreen';

function AppContent() {
  const { isAuthenticated, loading } = useAuth();
  const [sidebarOpen, setSidebarOpen] = useState(true);

  if (loading) {
    return <LoadingScreen />;
  }

  return (
    <div className="app-container">
      {isAuthenticated && <Navbar toggleSidebar={() => setSidebarOpen(!sidebarOpen)} />}
      <div className="main-content">
        {isAuthenticated && <Sidebar isOpen={sidebarOpen} />}
        <div className={`content ${isAuthenticated ? 'with-sidebar' : ''}`}>
          <Routes>
            {/* Public routes */}
            <Route path="/login" element={!isAuthenticated ? <Login /> : <Navigate to="/" />} />
            <Route path="/register" element={!isAuthenticated ? <Register /> : <Navigate to="/" />} />

            {/* Private routes */}
            <Route path="/" element={<PrivateRoute><Dashboard /></PrivateRoute>} />
            <Route path="/equipment" element={<PrivateRoute><Equipment /></PrivateRoute>} />
            <Route path="/equipment/add" element={<PrivateRoute><AddEquipment /></PrivateRoute>} />
            <Route path="/maintenance" element={<PrivateRoute><Maintenance /></PrivateRoute>} />
            <Route path="/maintenance/schedule" element={<PrivateRoute><SchedulePreventive /></PrivateRoute>} />
            <Route path="/maintenance/report" element={<PrivateRoute><ReportIssue /></PrivateRoute>} />
            <Route path="/tasks" element={<PrivateRoute><Tasks /></PrivateRoute>} />
            <Route path="/tasks/add" element={<PrivateRoute><AddTask /></PrivateRoute>} />
            <Route path="/users" element={<PrivateRoute><Users /></PrivateRoute>} />
            <Route path="/users/add" element={<PrivateRoute><AddUser /></PrivateRoute>} />
          </Routes>
        </div>
      </div>
    </div>
  );
}

function App() {
  return (
    <Router>
      <AuthProvider>
        <AppContent />
      </AuthProvider>
    </Router>
  );
}

export default App;
